# npc[] = endereco 0x10010000 + 67340
.word 38 11 26 8 63 8 65636 26                                                                                     
                                                                                                                                                                                                                                                                                                                                    
.text 
main:
	# cenario
	addi $25, $0, 128 # colunas
	addi $30, $0, 64 # linhas
	mul $26, $25, $30 # area
	addi $27, $0, 475 # assets + vetor 
	addi $6, $0, 512 # width do display
	addi $7, $0, 4 # porporcao width do display
	
	# armazena cenario e assets na memoria
	add $10, $27, $26 # contador
	add $8, $0, $10
	sll $8, $8, 2
	addi $8, $8, 0x10010000
	addi $8, $8, -4 # local a ser lido
	add $24, $0, $10
	sll $24, $24, 2
	add $24, $24, $8 
	sll $1, $27, 2
	sub $24, $24, $1 # local a ser armazenado
	jal store
	
	# load cenario
	lui $8, 0x1001 # local a ser escrito
	add $24, $0, $26
	sll $24, $24, 2
	add $24, $24, $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
	
	# aponta para os vetores
	lui $2, 0x1001
	addi $1, $0, 67308 # nave
	add $2, $2, $1
	
	lui $3, 0x1001
	addi $1, $0, 67340 # npc
	add $3, $3, $1
	
	# loop da animacao da tela
	# desenhar, apagar e controlar
animacao:
	bne  $0, $0, fimanimacao # comparador
	
	# parametros da nave
	lw $22, 0($2) # base  
	lw $23, 4($2) # altura 
	lw $18, 8($2) # x inicial
	lw $19, 12($2) # y inicial
	lw $20, 16($2) # x final
	lw $21, 20($2) # y final
	lw $28, 24($2) # inicio 
	lw $29, 28($2) # aux
	
	# load nave
	addi $8, $0 0x10010000
	add $8, $8, $28 # endereco de inicio na memoria
	add $9, $0, $22 # base
	add $10, $0, $23 # altura
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
	# parametros do npc
	lw $22, 0($3) # base  
	lw $23, 4($3) # altura 
	lw $18, 8($3) # x inicial
	lw $19, 12($3) # y inicial
	lw $20, 16($3) # x final
	lw $21, 20($3) # y final
	lw $28, 24($3) # inicio
	lw $29, 28($3) # aux
	
	# load npc
	addi $8, $0, 0x10010000
	add $8, $8, $28 # endereco de inicio na memoria
	add $9, $0, $22 # base 
	add $10, $0, $23 # altura 
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
	# delay
	addi $8, $0, 5000 # taxa de tempo de espera
	jal timer
	
# limpar
pers1:	

	# parametros da nave
	lw $22, 0($2) # base  
	lw $23, 4($2) # altura 
	lw $18, 8($2) # x inicial
	lw $19, 12($2) # y inicial
	lw $20, 16($2) # x final
	lw $21, 20($2) # y final
	lw $28, 24($2) # inicio
	lw $29, 28($2) # aux

	# limpar nave
	add $9, $0, $22 # base
	add $10, $0, $23 # altura
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo

# controle da nave
controle:
	lui $8, 0xffff
	lw $11, 0($8)
	beq $11, $0, naodig # se != 0 digitou algo
	addi $12, $0, 'd'
	lw $13, 4($8) # tecla digitada pelo usuario
	beq $12, $13, dir
	addi $12, $0, 'a'
	beq $12, $13, esq
	addi $12 $0 'p'
	beq $12, $13, end
	j naodig
dir:  		
	addi $18, $18, 3 # incrementa endereco pra direita
	j naodig
esq:
	addi $18, $18, -3 # incrementa endereco pra esquerda
naodig:
	
# continua p/ npc
fimpers1:
	
	# paramentros da nave
	sw $22, 0($2) # base  
	sw $23, 4($2) # altura 
	sw $18, 8($2) # x inicial
	sw $19, 12($2) # y inicial
	sw $20, 16($2) # x final
	sw $21, 20($2) # y final
	sw $28, 24($2) # inicio
	sw $29, 28($2) # aux
	
pers2:

	# parametros do npc
	lw $22, 0($3) # base  
	lw $23, 4($3) # altura 
	lw $18, 8($3) # x inicial
	lw $19, 12($3) # y inicial
	lw $20, 16($3) # x final
	lw $21, 20($3) # y final
	lw $28, 24($3) # inicio
	lw $29, 28($3) # aux
	
	# limpar npc
	add $9, $0, $22 # base 
	add $10, $0, $23 # altura 
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	
	# movimento automatico npc
ida2:	beq $18, $20, troca2 # troca x inicial e final
	bgt $18, $20, volta2 # loop da ida
	addi $18, $18, 1 # variacao do movimento
	j fimpers2
troca2:
	add $20, $0, $29 # x final = x inicial
	add $29, $0, $18 # extra = x final
	j fimpers2
volta2:	
	blt $18, $20, ida2 # loop da volta
	addi $18, $18, -1 # variacao do movimento
fimpers2:
	
	# parametros do npc
	sw $22, 0($3) # base  
	sw $23, 4($3) # altura 
	sw $18, 8($3) # x inicial
	sw $19, 12($3) # y inicial
	sw $20, 16($3) # x final
	sw $21, 20($3) # y final
	sw $28, 24($3) # inicio
	sw $29, 28($3) # aux
	
	j animacao

fimanimacao:
	
end:
	addi $2, $0, 10 # fim
	syscall
	
# carrega o cenario no display
load:	
	lw $9, 0($24)
	sw $9, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $10, $10, 1
	bne $10, $26, load
	jr $31
	
# guarda cenario e assets na memoria
store:
	lw $9, 0($8)
	sw $9, 0($24)
	addi $8, $8, -4
	addi $24, $24, -4
	addi $10, $10, -1
	bne $10, 0, store
	jr $31

# desenha personagem
personagem:  
	lui $15, 0x1001
	sll $11, $11, 2 # enderecos a percorrer no eixo x
	div $6, $7 # width / proporcao
	mflo $1
	sll $1, $1, 2 # enderecos a percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # quantidade de colunas
laco1:	beq $10, $0, fimlaco1
laco2:	beq $9, $0, fimlaco2
	lw $14, 0($8) # local a ler
	sw $14, 0($15) # local a desenhar
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # colunas--
	j laco2
fimlaco2:   
	div $6, $7 # width / proporcao
	mflo $1
	sll $1, $1, 2 # enderecos a percorrer no eixo y
	add $15, $15, $1
	sll $16, $13, 2 
	sub $15, $15, $16 # volta para a coluna inicial
	add $9, $0, $13 # valor inicial de colunas 
	addi $10, $10, -1 # linhas--  
	j laco1  
fimlaco1: 
	jr $31
            
# load cenario ap√≥s limpar
carregafundo:  
	lui $15, 0x1001
	sll $11, $11, 2 # enderecos a percorrer no eixo x
	div $6, $7 # width / proporcao
	mflo $1
	sll $1, $1, 2 # enderecos a percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # quantidade de colunas        
	lui $8, 0x1001 
	add $8, $8, $11
	add $8, $8, $12 # posicao inicial a ser desenhada
	add $12, $0, $26
	sll $12, $12, 2
	add $8, $8, $12
	    
laco1.1:
	beq $10, $0, fimlaco1.1
laco2.1:
	beq $9, $0, fimlaco2.1
	lw $14, 0($8) # local a ler
	sw $14, 0($15) # local a desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # colunas--
	j laco2.1
fimlaco2.1:    
	div $6, $7 # width / proporcao
	mflo $1
	sll $1, $1, 2 # enderecos a percorrer no eixo y
	add $15, $15, $1
	add $8, $8, $1
	sll $16, $13, 2 
	sub $8, $8, $16 # volta para a coluna inicial
	sub $15, $15, $16 
	add $9, $0, $13 # valor inicial de colunas
	addi $10, $10, -1 # linahs--  
	j laco1.1  
fimlaco1.1: 
	jr $31
	
# delay     
timer:	
	beq $8, $0, fimtimer
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	addi $8, $8, -1
	j timer
	
fimtimer: 
	jr $31
